import React from "react";
import { motion } from "framer-motion";

export default function Projects() {
  const cardProps = {
    initial: { opacity: 0, y: 40 },
    whileInView: { opacity: 1, y: 0 },
    transition: { duration: 0.6 },
    viewport: { once: true }
  };

  return (
    <section className="max-w-4xl mx-auto mb-10 p-6 bg-white dark:bg-gray-800 rounded-xl shadow-md">
      <h2 className="text-3xl font-semibold border-b pb-2 mb-6 text-purple-600 dark:text-purple-300">Projects</h2>

      <div className="space-y-8">
        <motion.div {...cardProps}>
          <h3 className="text-xl font-bold text-blue-600">Student Attendance Management System</h3>
          <p className="text-gray-700 dark:text-gray-300">
            Built using React and connected to a backend API. Features include adding/viewing student data through a user-friendly UI.
          </p>
        </motion.div>

        <motion.div {...cardProps}>
          <h3 className="text-xl font-bold text-blue-600">Kidney Stone Detection System</h3>
          <p className="text-gray-700 dark:text-gray-300">
            Developed a deep learning model to detect kidney stones, aiming to assist in early diagnosis and healthcare support.
          </p>
        </motion.div>

        <motion.div {...cardProps}>
          <h3 className="text-xl font-bold text-blue-600">Road Pavement Condition Analysis System</h3>
          <p className="text-gray-700 dark:text-gray-300">
            Created a system using deep learning for automating road condition analysis, improving infrastructure evaluation accuracy.
          </p>
        </motion.div>
      </div>
    </section>
  );
}
